import React, { Component } from 'react';
import classes from'./Header.module.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Preorders from '../../../Orders/order';
import BurgerBuilder from'../../../Container/BurgerBuilder/BurgerBuilder';
class Header extends Component{
 render(){
     return (
        <Router><div className={classes.header}>  
        Welcome To Order! 
        <a className={classes.label1}   onClick={()=>{
                            this.props.history.push('/')
                            this.props.history.go()
                           }}
                             > BurgerBuilder</a>
         <a className={classes.label2} > 
            <Link to ="/order" > Orders</Link></a>
         {/* <Route path="/order" ><Preorders/> </Route> 
         <Route exact path="/" children={<BurgerBuilder/>}/>  */}
        </div> 
        </Router>
    )
 }
}
export default Header;
